script: |
  super -f text -I q9225.spq | sort > q9225.out

inputs:
  - name: q9225.spq
    data: |
      SELECT - - 57 + ( col1 ) * + 73 * - col1 AS col0, - col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 * + col0 NOT BETWEEN NULL AND + col1 + col0;
  - name: tab1

outputs:
  - name: q9225.out
    data: |
